import Card from "@material-tailwind/react/Card";
import CardImage from "@material-tailwind/react/CardImage";
import CardBody from "@material-tailwind/react/CardBody";
import CardFooter from "@material-tailwind/react/CardFooter";
import H6 from "@material-tailwind/react/Heading6";
import Paragraph from "@material-tailwind/react/Paragraph";
import Button from "@material-tailwind/react/Button";


import classes from './Productcard.module.css';
import Card_Image from './CardImage/CardImage';

import demo1 from '../../assets/images/AORUS3080Ti12G.png';


function Productcard() {
    return (

        <div className="container mx-auto grid sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 pt-6 gap-8">

                    <div className="rounded border-gray-300 dark:border-gray-700 border-dashed border-2 h-24">

                    <Card>
                        <CardImage className={classes.cardImageStyle}
                            src={demo1}
                            alt="Card Image"
                        />

                        <CardBody>
                            <H6 color="gray">AORUS RTX 3090TI</H6>
                            <Paragraph color="gray">
                                Don't be scared of the truth 
                            </Paragraph>
                        </CardBody>

                        <CardFooter>
                            <Button color="lightBlue" size="lg" ripple="light">
                                Add to Cart
                            </Button>
                            <Button color="lightBlue" size="lg" ripple="light">
                                Add to Fav
                            </Button>
                        </CardFooter>
                    </Card>




                    </div>

                    <div className="rounded border-gray-300 dark:border-gray-700 border-dashed border-2 h-24">




                    </div>

                    <div className="rounded border-gray-300 dark:border-gray-700 border-dashed border-2 h-24">




                    </div>

                    <div className="rounded border-gray-300 dark:border-gray-700 border-dashed border-2 h-24">


                    </div>
        </div>

    )
}

export default Productcard;
